  \"2016-01-07T13:53:00.102308\",\n\t\"name\": \"population-size-and-production-of-geese-and-eiders-nesting-on-the-yukon-kuskokwim-delta-al\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Annual assessment of nesting populations
  of geese on the YukonKuskokwim DeltaYKD provides information for biologists, participants
  in cooperative goose managementplans, and Pacific Flyway technical committees. A
  groundbased sampling procedure hasbeen used since 1986 to estimate the number of
  total nests, active nests, and eggs for cacklingCanada geese Branta canadensis minima,
  emperor geese Chen canagica, greater white frontedgeese Anser albifrons frontalis,
  and spectacled eiders Somateria fischeri. Annual information on the size of the
  nesting population and potential number of young producedcontributes long term data
  needed to understand goose and eider population ecology andbetter manage these species.
  Highlights of the 1998 season included: 1 late nesting chronology relative to theprevious
  5 years; 2 increases in nest numbers from 1997 for spectacled eider, swan, crane,and
  all geese; and 3 highest recorded number of cackler and whitefronted goose nests
  sincesurveys began in 1986.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
